                <div id="storeNew">
                    Store Name: 
                    <input type="text" name="name" onInput={descriptionChange}></input>
                </div>
                <div id="todoCompleted">
                    <span>Todo Completed?:</span>
                    <label className="switch"> 
	                    <input className="switch-input" type="checkbox" onChange={(e) => completedChange(e)} />
	                    <span className="switch-label" data-on="true" data-off="false"></span> 
	                    <span className="switch-handle"></span> 
                    </label>
                </div>
                <button type="submit">Add</button>
            </form>
        </div>
    );
}

export async function handleSubmit({ description = "filler", completed = false}) {

    var myHeaders = new Headers();
    myHeaders.append("Content-Type", "application/json");

    var raw = JSON.stringify({
        "description": description,
        "completed": completed
    });

    var requestOptions = {
        method: 'POST',
        headers: myHeaders,
        body: raw,
        redirect: 'follow'
    };

    fetch("http://localhost:3001/todo", requestOptions)
        .then(response => response.text())
        .then(result => console.log(result))
        .catch(error => console.log('error', error));
}
